Also, the distance is calculated by the square root of the sum of squares of x and y, but as x1 and y1 are integers, they are squared, and then the square root function is applied to the sum. The typecasting of `(a * a + b * b)` to double is required to prevent loss of precision. This is corrected in the revision.
